import React, { C, Component} from "react";
import axios from 'axios';

import { Container, Row, Col, Card, Button } from 'react-bootstrap';  

/* -OR-
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
*/

//Global variable for RESTAPI URL
const url = "https://jsonplaceholder.typicode.com/photos" 

export default class ReactBootstrap extends Component
{
   constructor(props) {
   super(props);
   this.state = 
   { 
     photos: [] //empty array
   }
   } 
   
   
   render() {

    return(<>
        <div className="container text-center">
            <h2>REACT BOOTSTRAP UI PACKAGE</h2>

        </div>
    
    
    </>)
     
    
  }
  //render
  componentDidMount()
    {
        axios.get(url).then((result) => this.setState({ userData:result.data }));
    }    

    
}
